import React, { useState } from "react";
import watch1 from "../assets/watch1.png"; 
import watch2 from "../assets/watch2.png"; 
import watch3 from "../assets/watch3.png"; 
import watch4 from "../assets/watch4.png"; 
import watch5 from "../assets/watch5.png"; 
import watch6 from "../assets/watch6.png"; 
import watch7 from "../assets/watch7.png"; 
import watch8 from "../assets/watch8.png"; 

const Products = () => {
  const [items] = useState([
    { name: "GOLDEN HOUR Waterproof Sport Women's Watch", quantity: 10, imageUrl: watch1 },
    { name: "Classic Titan Ladies Watch", quantity: 15, imageUrl: watch2 },
    { name: "Rose Gold Elegant Watch", quantity: 8, imageUrl: watch3 },
    { name: "Modern Chronograph Watch", quantity: 5, imageUrl: watch4 },
    { name: "Luxury Diamond Watch", quantity: 3, imageUrl: watch5 },
    { name: "Casual Day Watch", quantity: 20, imageUrl: watch6 },
    { name: "Sport Chrono Watch", quantity: 12, imageUrl: watch7 },
    { name: "Modern Smart Watch", quantity: 9, imageUrl: watch8 },
  ]);

  return (
    <div className="min-h-screen p-8 bg-gray-100">
      <h1 className="text-3xl font-bold text-center text-gray-800">Product List</h1>
      <div className="mt-6 grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-8">
        {items.map((item, index) => (
          <div
            key={index}
            className="bg-white rounded-lg shadow-lg p-4 flex flex-col items-center justify-center hover:shadow-2xl transition duration-300"
          >
            <img
              src={item.imageUrl}
              alt={item.name}
              className="w-48 h-48 object-contain rounded-lg"
            />
            <h2 className="mt-3 text-lg font-semibold text-gray-700">{item.name}</h2>
            <p className="text-gray-600">Quantity: {item.quantity}</p>
            <div className="mt-4 flex space-x-3">
              <button className="bg-blue-500 hover:bg-blue-600 text-white rounded-full px-4 py-2">
                Edit
              </button>
              <button className="bg-red-500 hover:bg-red-600 text-white rounded-full px-4 py-2">
                Delete
              </button>
              <button className="bg-green-500 hover:bg-green-600 text-white rounded-full px-4 py-2">
                Add to Cart
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Products;
